import React from "react";

function Footer() {
  return (
    <footer className="flex bg-blue-700 fixed bottom-0 w-full py-3 px-3">
            <div className="w-1/3 text-center ">
                <img className="text-white mx-auto" src="img/dashboard_24px_outlined.svg" alt=""  />
                <h1 className="text-white text-xs">Overview</h1>
            </div>
            <div className="w-1/3 text-center">
                <img className="mx-auto" src="img/account_balance_wallet_24px_outlined.svg" alt=""  />
                <h1 className="text-white text-xs">Loans</h1>
            </div>
            <div className="w-1/3 text-center">
                <img className="mx-auto" src="img/file_copy_24px_outlined.svg" alt=""  />
                <h1 className="text-white text-xs">Documents</h1>
            </div>
        </footer>
  );
}

export default Footer;
